import React from 'react'

class Homepage extends React.Component {
    render() {
        return (
            <div className='position-relative'>
                <div className="home position-absolute start-50 translate-middle">
                <div className='home-head'>
                    <p>Welcome to the Wild Oaks Ranch</p>
                </div>
                <div className="home-body">
                    <p>
                        Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vestibulum pulvinar vulputate euismod. Donec dignissim libero non sodales iaculis. Orci varius natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Morbi eget mattis lectus. Donec pulvinar, odio vel iaculis eleifend, dolor tortor egestas turpis, lobortis lobortis diam erat ac eros. Pellentesque tempus porttitor nulla non pretium. Fusce tempor sit amet justo eget dapibus. Etiam ut quam vitae diam feugiat efficitur. Vestibulum malesuada sit amet felis eget pellentesque. Nam vehicula aliquet ex, quis posuere est sagittis hendrerit. Quisque varius iaculis dui ut commodo.
                    </p>
                </div>
                </div>
                
            </div>
        )
    }
}

export default Homepage
